service_name: VersionService
provider: Consul
strategy: random
consul_name: data.abtest.versionmanager
default_port: 7701
socket: service_rpc.client.protocal.thrift_ext.transport.TGeventSocket.TGeventSocket
transport: thrift.transport.TTransport.TBufferedTransport
protocol: thrift.protocol.TBinaryProtocol.TBinaryProtocolAccelerated
retry: 0
connect_timeout: 0.05s
timeout: 0.25s
tag: default